import { Grid } from '@mui/material';
import React, { Component } from 'react';
import "./Mainpage.css"

class Layout extends Component {
    render() { 
        return (
            <div className='mainpage_container'>
               <Grid container >
                <Grid item xs={3}></Grid>
                <Grid item xs={6}></Grid>
                <Grid item xs={3}></Grid>
               </Grid>

            </div>
        );
    }
}
 
export default Layout;
